import { Story } from "@storybook/react";

import { ToDoItem, ToDoItemProps } from "./ToDoItem";

export default {
  title: "Components/ToDoItem",
  component: ToDoItem,
};

const DummyToDo = (args: any) => {
  const [completed, setCompleted] = React.useState(args.task.completed);

  return (
    <ToDoItem
      {...args}
      task={{ ...args.task, completed: completed }}
      onToggle={() => {
        setCompleted(!completed);
      }}
    />
  );
};

const Template: Story<ToDoItemProps> = (args) => {
  const [completed, setCompleted] = React.useState(args.task.completed);

  return (
    <div style={{ width: 400, padding: 32, background: "#eee" }}>
      <DummyToDo {...args} />
      <DummyToDo {...args} />
      <DummyToDo {...args} />
      <DummyToDo {...args} />
      <DummyToDo {...args} />
    </div>
  );
};

export const Simple = Template.bind({});
Simple.args = {
  task: {
    id: "1",
    title: "Hello world",
    details: "Some details about the task",
    completed: false,
  },
};
